tables.table_schema:
CREATE TABLE PropertyInspections (
    inspection_id SERIAL PRIMARY KEY,
    property_address VARCHAR(255) NOT NULL,
    inspection_date DATE NOT NULL,
    inspector_name VARCHAR(100) NOT NULL
);

CREATE TABLE ComplianceRegulations (
    regulation_id SERIAL PRIMARY KEY,
    regulation_name VARCHAR(100) NOT NULL,
    regulation_description TEXT
);

CREATE TABLE InspectionResults (
    result_id SERIAL PRIMARY KEY,
    inspection_id INT REFERENCES PropertyInspections(inspection_id),
    regulation_id INT REFERENCES ComplianceRegulations(regulation_id),
    result VARCHAR(50) NOT NULL
);

CREATE TABLE regulations (
   regulation_id SERIAL PRIMARY KEY,
   title VARCHAR(100),
   description TEXT,
   regulation_date DATE
);

CREATE TABLE Inspectors (
   inspector_id UUID PRIMARY KEY,
   inspector_name TEXT,
   email TEXT,
   phone_number TEXT
);

CREATE TABLE Regulations (
   regulation_id UUID PRIMARY KEY,
   regulation_name TEXT,
   description TEXT,
   compliance_deadline TIMESTAMP
);
